import React from "react";
import styled from "styled-components";

const styledMainPageContainer = styled.div`
  display: flex;
  flex-direction: wrap;
`;

const StyledHero = styled.div`
  display: flex;
  flex-direction: wrap;
  text-align: center;
`;
export default function Mainpage() {
  return (
    <styledMainPageContainer>
      <StyledHero>
        <h1>Your favourite food, delivered while coding</h1>
        <button></button>
      </StyledHero>
      <div>
        <h4>Food Delivery in Gotham City</h4>
        <div>
          <div>
            <img></img>
            <h5>McDonald's</h5>
            <p>$ - American - Fast Food - Burgers</p>
            <div>
              <p>20-30 Min</p>
              <p>$5.99 Delivery Fee</p>
            </div>
          </div>
        </div>
      </div>
    </styledMainPageContainer>
  );
}
